import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import logo from '../assets/ux/techhub/TechHub-logotype.png'
import Illustrator from '../assets/tools/illustrator.svg'
import Indesign from '../assets/tools/indesign.svg'
import Photoshop from '../assets/tools/photoshop.svg'
import Xd from '../assets/tools/xd.svg'

export default function UxWorkThumb(props) {

    return (
        <div className="work-thumb">
            <Link to={"/ux-design/"+props.path}>
                <div>
                    <img width="300" src={props.logotype}></img>
                    <h2>{props.subcat.map((s, k) => {
                        if (k == props.subcat.length - 1) {
                            return s;
                        } else {
                            return s + ', ';
                        }
                    })}</h2>
                    <div>
                        {}
                    </div>
                    <img width="300" src={props.cover}></img>

                </div>
            </Link>
        </div>
    )
}
